pragma solidity 0.8.9;
/**
 * Contract that manages the control access to underlying smart contracts.
 */
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract TailorControlAccess is
    Initializable,
    AccessControlUpgradeable,
    OwnableUpgradeable
{
    bytes32 internal constant TAILOR_ADMIN = keccak256("TAILOR_ADMIN"); // 0x3f6ce2d5571ab8f3fb1cf068a92ec99edc01aa4a757338b1f082acee66c84cb2
    bytes32 internal constant COLLECTION_CREATOR =
        keccak256("COLLECTION_CREATOR"); // 0x605f3e359b5224b78fd55afc82a0086dba41cff5d3cb8e860e84b9e27d7c4dfa
    bytes32 internal constant TRUSTED_FORWARDER =
        keccak256("TRUSTED_FORWARDER"); // 0xba1aa5bbc6b8041418eeb66d935650729704cb07d45789621b0f966fb6decb10
    bytes32 internal constant ASSET_TRANSFERER = keccak256("ASSET_TRANSFERER"); //0xffa4d2dfa347ca387d9d26d2cfce2135e24275eab3a5fa873cd0254815377cad

    function __TailorControlAccess_init_unchained() internal initializer {
        __AccessControl_init();
        __Ownable_init();
        __setRoles_init();
    }

    function __TailorControlAccess_init() internal initializer {
        __TailorControlAccess_init_unchained();
    }

    function __setRoles_init() internal onlyInitializing {
        _grantRole(DEFAULT_ADMIN_ROLE, _msgSender());
    }

    /**
     * @dev Role checks modifiers
     */
    modifier onlyTailor() {
        require(_onlyTailor(), "Not Tailor");
        _;
    }

    modifier onlyAdmin() {
        require(_onlyAdmin(), "Not Admin");
        _;
    }

    modifier onlyCollectionCreator() {
        require(
            hasRole(TAILOR_ADMIN, _msgSender()) ||
                hasRole(COLLECTION_CREATOR, _msgSender()),
            "Not Collection Creator"
        );
        _;
    }

    /**
     * @dev Internal role checks methods
     */
    function _onlyTailor() internal view returns (bool) {
        return hasRole(DEFAULT_ADMIN_ROLE, _msgSender());
    }

    function _onlyAdmin() internal view returns (bool) {
        return hasRole(TAILOR_ADMIN, _msgSender());
    }

    function _isTrustedForwarder(address forwarder)
        internal
        view
        returns (bool)
    {
        return hasRole(TRUSTED_FORWARDER, forwarder);
    }

    function _isAssetTransferer() internal view returns (bool) {
        return hasRole(ASSET_TRANSFERER, _msgSender());
    }

    /**
     * @dev Add Roles methods
     */
    function addAdmin(address _address) public {
        grantRole(TAILOR_ADMIN, _address);
    }

    function addCollectionCreator(address _address) public {
        grantRole(COLLECTION_CREATOR, _address);
    }

    function addTrustedForwarder(address _address) public {
        grantRole(TRUSTED_FORWARDER, _address);
    }

    function addAssetTransferer(address _address) public {
        grantRole(ASSET_TRANSFERER, _address);
    }

    /**
     * @dev Revoke Roles methods
     */
    function removeAdmin(address _address) public {
        revokeRole(TAILOR_ADMIN, _address);
    }

    function removeCollectionCreator(address _address) public {
        revokeRole(COLLECTION_CREATOR, _address);
    }

    function removeTrustedForwarder(address _address) public {
        revokeRole(TRUSTED_FORWARDER, _address);
    }

    function removeAssetTransferer(address _address) public {
        revokeRole(ASSET_TRANSFERER, _address);
    }

    /**
     * @dev See {OwnableUpgradeable.transferOwnership}
