pragma solidity 0.8.9;

import "@openzeppelin/contracts-upgradeable/interfaces/IERC2981Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/interfaces/IERC165Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/introspection/ERC165Upgradeable.sol";

import "../../access/TailorControlAccess.sol";

contract TailorRoyalties is
    IERC2981Upgradeable,
    ERC165Upgradeable,
    TailorControlAccess
{
    function __ERC2981_init() internal onlyInitializing {}

    function __ERC2981_init_unchained() internal onlyInitializing {}

    struct RoyaltyInfo {
        address receiver;
        uint96 royaltyFraction;
    }

    RoyaltyInfo internal _defaultRoyaltyInfo;

    mapping(uint256 => RoyaltyInfo) internal _tokenRoyaltyInfo;
    mapping(uint128 => RoyaltyInfo) internal _collectionRoyaltyInfo;

    event DefaultRoyaltySet(address receiver, uint96 feeNumerator);
    event CollectionRoyaltySet(
        uint128 collectionId,
        address receiver,
        uint96 feeNumerator
    );

    /**
     * @dev The denominator with which to interpret the fee set in {_setTokenRoyalty} and {_setDefaultRoyalty} as a
     * fraction of the sale price. Defaults to 10000 so fees are expressed in basis points, but may be customized by an
     * override.
     */
    function _feeDenominator() internal pure virtual returns (uint96) {
        return 10000;
    }

    /**
     * @dev Sets the royalty information that all ids in this contract will default to.
     * @param receiver address of receiver
     * @param feeNumerator fee numerator
     */
    function setDefaultRoyalty(address receiver, uint96 feeNumerator)
        public
        onlyAdmin
    {
        _setDefaultRoyalty(receiver, feeNumerator);

        emit DefaultRoyaltySet(receiver, feeNumerator);
    }

    /**
     * @dev Sets the royalty information that all ids in this contract will default to.
     *
     * Requirements:
     *
     * - `receiver` cannot be the zero address.
     * - `feeNumerator` cannot be greater than the fee denominator.
     */
    function _setDefaultRoyalty(address receiver, uint96 feeNumerator)
        internal
        virtual
    {
        require(
            feeNumerator <= _feeDenominator(),
            "ERC2981: royalty fee will exceed salePrice"
        );
        require(receiver != address(0), "ERC2981: Invalid receiver");

        _defaultRoyaltyInfo = RoyaltyInfo(receiver, feeNumerator);
    }

    /**
     * @dev Sets the royalty information for a specific collection id.
     * @param collectionId collection id
     * @param receiver address of receiver
     * @param feeNumerator fee numerator
     */
    function _setCollectionRoyalty(
        uint128 collectionId,
        address receiver,
        uint96 feeNumerator
    ) internal {
        require(
            feeNumerator <= _feeDenominator(),
            "ERC2981: royalty fee will exceed salePrice"
        );
        require(receiver != address(0), "ERC2981: Invalid receiver");

        _collectionRoyaltyInfo[collectionId].receiver = receiver;
        _collectionRoyaltyInfo[collectionId].royaltyFraction = feeNumerator;

        emit CollectionRoyaltySet(collectionId, receiver, feeNumerator);
    }

    function getCollectionRoyalty(uint128 collectionId)
        public
        view
        returns (address, uint96)
    {
        if (_collectionRoyaltyInfo[collectionId].receiver == address(0)) {
            return (
                _defaultRoyaltyInfo.receiver,
                _defaultRoyaltyInfo.royaltyFraction
            );
        }

        return (
            _collectionRoyaltyInfo[collectionId].receiver,
            _collectionRoyaltyInfo[collectionId].royaltyFraction
        );
    }

    /**
     * @inheritdoc IERC2981Upgradeable
     */
    function royaltyInfo(uint256 _tokenId, uint256 _salePrice)
        external
        view
        virtual
        override
        returns (address, uint256)
    {}

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(
            AccessControlUpgradeable,
            IERC165Upgradeable,
            ERC165Upgradeable
        )
        returns (bool)
    {
        return
            interfaceId == type(IERC2981Upgradeable).interfaceId ||
            super.supportsInterface(interfaceId);
    }

